  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>69.95 EUR</g:price><g:brand>SPM</g:brand><size></size><color>bruin</color><category>Laarzen</category><parent></parent></item><item><g:id>0183</g:id><title><![CDATA[ Equo suede enkellaars ]]></title><description><![CDATA[ Trendy enkellaars van het merk Equo uitgevoerd in een combinatie van suede en leer. De schoen heeft een bergschoensluiting en sluit met veters. De laars is aan de bovenkant van de schacht afgewerkt met een leren applicatie en is aan de binnenkant ook volledig leer gevoerd.  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>39.95 EUR</g:price><g:brand>Equo</g:brand><size></size><color>beige</color><category>Laarzen</category><parent></parent></item><item><g:id>0162</g:id><title><![CDATA[ Equo enkellaars met hak ]]></title><description><![CDATA[ Trendy enkellaars van het merk Equo Shoes uitgevoerd in zwart suede. Deze laars heeft een mooie garnering aan de onderkant en staat prachtig aan de voet. Een goede koop voor de modebewuste vrouw!  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>69.95 EUR</g:price><g:brand>Equo</g:brand><size></size><color>zwart</color><category>Laarzen</category><parent></parent></item><item><g:id>5-25300-28</g:id><title><![CDATA[ s Oliver laarsjes ]]></title><description><![CDATA[ Gave blauwe laarsjes van het merk s.Oliver uitgevoerd in broque leer en geplooid textiel. Dit laarsje is afgewerkt met sierstiksels en sluit aan de binnenkant met een rits.  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>29.95 EUR</g:price><g:brand>s.Oliver</g:brand><size></size><color>blauw</color><category>Laarzen</category><parent></parent></item><item><g:id>KA7034402-B-001</g:id><title><![CDATA[ SPM open pumps ]]></title><description><![CDAT