311372-B-001</g:id><title><![CDATA[ SPM gevlochten enkellaars ]]></title><description><![CDATA[ Rode enkellaarzen van het merk SPM. Dit is een instapmodel. Opvallend aan deze dameslaarzen is de gevlochten decoratie aan de zijkanten van de schacht. De laarzen zijn gemaakt van echt leer en zijn voorzien van een rubberen zool. De rode kleur is een trendy kleur die je veel terug ziet in het modebeeld van nu.  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>39.95 EUR</g:price><g:brand>SPM</g:brand><size></size><color>rood</color><category>Laarzen</category><parent></parent></item><item><g:id>25433</g:id><title><![CDATA[ s Oliver 25433 enkellaars met hak ]]></title><description><![CDATA[ Korte enkellaarzen, model 25433 uitgevoerd in de makkelijk combineerbare kleur zwart. De korte laarsjes zijn van het merk s.Oliver en voorzien van een handige ritssluiting aan de binnenkant van de schacht. De slangenprint op de hiel en de stoere rubberen hak maken de laarsjes helemaal af! 
