LET OP: deze pumps vallen klein, wij adviseren je dan ook een maat groter te bestellen.  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>29.95 EUR</g:price><g:brand>s.Oliver</g:brand><size></size><color>rood</color><category>Pumps</category><parent></parent></item><item><g:id>15196864</g:id><title><![CDATA[ SPM 15196864 korte laarsjes ]]></title><description><![CDATA[ Stoere korte dames boeties van het merk SPM, gemaakt van premium leer in een mooie cognac kleur. Aan de bovenkant is de laars afgewerkt met geperforeerd leer. Als accent is de laars voorzien van een zilveren gesp en leren details op de hiel. Heel gaaf in combinatie met een mooie jeans, jurk of rokje.  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>59.95 EUR</g:price><g:brand>SPM</g:brand><size></size><color>Cognac</color><category>Laarzen</category><parent></parent></item><item><g:id>KA5311043-B-002</g:id><title><![CDATA[ SPM korte laars ]]></title><description><![CDATA[ Stoere enkellaarzen van het merk SPM, gemaakt van gevet leer in een makkelijk te combineren blauwe kleur. Aan de zijkant van het laarsjes zit een cognac kleurige streep. Als accent is de laars voorzien van sierstiksels en is aan beide zijkanten voorzien van een leren lus.  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>49.95 EUR</g:price><g:brand>SPM</g:brand><size></size><color>blauw</color><category>Laarzen</category><parent></parent></item><item><g:id>18816692</g:id><title><![CDATA[ SPM lambo sandaal grijs 18816692 ]]></title><description><![CDATA[ Zomerse sandaal, model 18816692 van het merk SPM uitgevoerd in de makkelijke kleur grijs. De sandaal is voorzien van  een mooie vlechtband en een witte rubberen zool met fijn profiel. De hak lijkt hoog maar door de plateauzool valt dit in werkelijkheid mee. De sandaal is comfortabel gevoerd en heeft een hoog draagcomfort. Draag deze sandalen onder een maxi dress of gave short en begin de zomer in style!  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>49.95 EUR</g:price><g:brand>SPM</g:brand><size></size><color>grijs</color><category>Slippers-sandalen</category><parent></parent></item><item><g:id>F7IWB042241</g:id><title><![CDATA[ Mexx bruine enkellaars ]]></title><description><![CDATA[ Trendy bruin enkellaarsje van het merk Mexx uitgevoerd met mooie hak en glad leren accenten.  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>59.95 EUR</g:price><g:brand>Mexx</g:brand><size></size><color>bruin</color><category>Laarzen</category><parent></parent></item><item><g:id>0160</g:id><title><![CDATA[ Equo bruine laars ]]></title><description><![CDATA[ Leren laarzen van het merk Equo uitgevoerd in bruin/cognac leer. De laarzen hebben een elegante houten hak en een gesp aan de achterkant van de schacht. Verder heeft de laars een ritssluiting aan de binnenzijde van de schacht, waardoor deze gemakkelijk is aan te trekken. Een goede koop voor de modebewuste vrouw!  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>69.95 EUR</g:price><g:brand>Equo</g:brand><size></size><color>bruin</color><category>Laarzen</category><parent></parent></item><item><g:id>5-25314-29</g:id><title><![CDATA[ s Oliver grijze enkellaarsjes ]]></title><description><![CDATA[ Grijze enkellaarzen voor dames van het merk s.Oliver. De enkellaarzen zijn voorzien van een ritssluiting, twee decoratieve riempjes en een houtlook hak. Ideaal laarsje voor alledag!  ]]></description><qty>0</qty><g:condition>new</g:condition><g:availability>out of stock</g:availability><g:price>49.95 EUR</g:price><g:brand>s.Oliver</g:brand><size></size><color>grijs</color><category>Laarzen</category><parent></parent></item><item><g:id>5-224